import React, { useEffect, useState } from "react";

function FeedbackTable() {
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/contact/all") // adjust port if different
      .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          setFeedbacks(data.data);
        }
      })
      .catch((err) => console.error("Error fetching feedback:", err));
  }, []);

  return (
    <div className="p-6">
      <h2>ðŸ“‹ Feedback Entries (Developer Only)</h2>
      <table border="1" cellPadding="8" style={{ width: "100%", marginTop: "20px" }}>
        <thead>
          <tr style={{ background: "#f4f4f4" }}>
            <th>Name</th>
            <th>Email</th>
            <th>Message</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {feedbacks.length > 0 ? (
            feedbacks.map((fb) => (
              <tr key={fb._id}>
                <td>{fb.name}</td>
                <td>{fb.email}</td>
                <td>{fb.message}</td>
                <td>{new Date(fb.date).toLocaleString()}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" style={{ textAlign: "center" }}>
                No feedback yet.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}

export default FeedbackTable;
